import React from "react";

function BusinessProfile({ nextPage, prevPage }) {
  return (
    <div>
      {/* Step 2 Heading */}
      <h2 className="text-2xl font-semibold mb-6">Step 2: Business Profile</h2>

      {/* Enter business information message */}
      <p className="text-lg text-gray-700 mb-6">Enter the business information for your account</p>

      {/* Form Fields */}
      <div className="grid grid-cols-1 gap-4 md:grid-cols-2">
        {/* Left side - Business Name */}
        <div>
          <label className="block text-gray-700">Business Name</label>
          <input
            type="text"
            className="w-full px-4 py-2 border rounded-lg focus:outline-none focus:border-blue-500"
            placeholder="Business Name"
          />
        </div>

        {/* Left side - Industry */}
        <div>
          <label className="block text-gray-700">Industry</label>
          <input
            type="text"
            className="w-full px-4 py-2 border rounded-lg focus:outline-none focus:border-blue-500"
            placeholder="Industry"
          />
        </div>

        {/* Left side - Company Size */}
        <div>
          <label className="block text-gray-700">Company Size</label>
          <input
            type="number"
            className="w-full px-4 py-2 border rounded-lg focus:outline-none focus:border-blue-500"
            placeholder="Company Size"
          />
        </div>
      </div>

      {/* Navigation Buttons */}
      <div className="flex justify-between mt-4">

      </div>
    </div>
  );
}

export default BusinessProfile;
